    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1953.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and wildfires during this period. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, raptors, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. The public relations
    section of the report describes recreational uses, Refuge visitors, and Refuge participation.
    N-R forms, photographs, and narrative reports on Clear Lake National Wildlife Refuge,
    Upper Klamath National Wildlife Refuge, and Lower Klamath National Wildlife Refuge
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
